import { Followers } from "../../pages/followers";
import { Section, Title, ListOfFollowers, Follow } from "./styles";

const FollowersContainer = (props) => {
    return (
        <Section>
            <Title>Followers of {props.name?.split("")[0]}</Title>
            <ListOfFollowers>
                {(props?.Followers).map((followers) => (
                    <Follow>
                        <h2>{Followers?.login}</h2>
                        <p>{Followers?.url}</p>
                    </Follow>
                ))}
            </ListOfFollowers>
        </Section>
    );
};

export default FollowersContainer;
